export default async function GetAllPosts() {
    try {
        const response = await fetch(`http://localhost:5001/posts`);
        const data = await response.json();
        if (response.status === 200) {
            return data;
        } else {
            if (data.errors !== undefined) {
                alert(data.errors[0].msg);
                return;
            }
            alert(data.message);
        }
    } catch (error) {
        alert(error.message);
    }
}
